import { getAverageTime } from "./getAverageTime";

export const getSleepingAverage = (
  thisDetailSumTime: any,
  lastDetailSumTime: any
) => {
  return {
    thisWakeUp: getAverageTime(thisDetailSumTime.sumWakeUp),
    lastWakeUp: getAverageTime(lastDetailSumTime.sumWakeUp),
    thisNight: getAverageTime(thisDetailSumTime.sumNight),
    lastNight: getAverageTime(lastDetailSumTime.sumNight),
  };
};
